import React from 'react'
import Room from './Room'
import {Link} from 'react-router-dom'

const RoomList = ({ rooms }) => {
    return (
        <div>
                {rooms && rooms.map(room => (
                    <Link>
                        <Room key={room._id} name={room.name} />    
                    </Link>
                ))}
        </div>
    )
}

export default RoomList
